 ('2', '2', 'en_us', 'Home', '<p>If you are a high school student planning your future, then Kent Roosevelt Career Technical programs is the place for you!  Learn in our high-tech facility from instructors with real-world experience. The Kent Roosevelt High School Career Technical programs are open to students within the Six District Educational Compact.  For an application, to schedule an individual tour, or request more information –call (330) 676-8740 or see your school counselor.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, 'Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus.', 'Admissions', NULL, NULL, NULL, '1', 'News', 'Explore Pathways', 'Welcome to Kent Rosevelt', NULL, NULL, NULL, NULL, '2017-04-18 15:33:03', '2017-06-27 17:37:29', '35ea2da5-4e56-4a77-aca1-2b79c89ab6b8'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Careertech.web. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-04-18 15:33:03', '2017-04-18 15:33:03', '6e8a8219-d4b2-414f-83b2-2e7ea4c30de9'),
